//直接更新state的多个方法的对象
import {
    RECEIVE_POSTS,
    RECEIVE_PROFILE
} from './mutations-type'
 export default {
    [RECEIVE_POSTS] (state,{posts}){
        state.posts = posts
        console.log( state.posts)
    },

    [RECEIVE_PROFILE] (state,{profile}){
        state.profile = profile
        console.log( state.profile)
    }
 }
